import React from 'react';
import photo from '../images/photo.png'
import gc_logo from '../images/gc logo.png'

const Exp = () => {
  return (
  <>
        <div>
          <img src={photo} alt="" width="100" height="100"/>
          <img src={gc_logo} alt="" width="50%" height="50%"/>
        </div>


    <>
        <h2>Experience</h2>
    </>


    </>
  );
}

export default Exp;
